import { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import axios from 'axios';


function Register(){

    const [firstName, setFirstName] = useState("");
    var[firstNameError, setFirstNameError]=useState("")
    const [lastName, setLastName] = useState("");
    var[lastNameError,setLastNameError]=useState("")
    const [email, setEmail] = useState("");
    var[emailError,setEmailError]=useState("");
    const [mobileNo, setMobileNo] = useState("");
    var[mobileNoError,setMobileNoError]=useState("");
    const [password, setPassword] = useState("");
    var[passwordError,setPasswordError]=useState("");
    const [userType, setuserType] = useState('Customer');
    var[userTypeError,setUserTypeError]= useState("");

    const url = "http://127.0.0.1:9999/register";
    
    const OnTextChageFirstName=(args)=>{
        setFirstName(args.target.value);
    }

    const OnTextChageLastName=(args)=>{
        setLastName(args.target.value);
    }

    const OnTextChageEmail=(args)=>{
       setEmail(args.target.value);
    }
    
    const OnTextChagMobileNo=(args)=>{
        setMobileNo(args.target.value);
    }
    const OnTextChagePassword=(args)=>{
        setPassword(args.target.value);
    }
    
    const OnTextChageUserType=(args)=>{
        setuserType(args.target.value);
    }
    
    const Validate=()=>{
        //initially set to empty 
        setEmailError("");
        setPasswordError("");

        if(firstName===""){
            setFirstNameError("*Please Enter Your Email")
            return;
        }
        if(lastName===""){
            setLastNameError("*Please Enter Your Email")
            return;
        }
        if(mobileNo===""){
            setEmailError("*Please Enter Your Email")
            return;
        }
        if(email===""){
            setEmailError("*Please Enter Your Email")
            return;
        }
        if (!/^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/.test(email)) {
            setEmailError("*Please enter a valid email")
            return
        }
        if(""===password)
        {
            setPasswordError("*Please Enter your Password");
            return ;
        }
        if(password.length<8){
            setPasswordError("*Password must be  8 characters or Longer");
            return;
        }
    };


    return (
      <div className="container">
          <center>
            <form>
                First Name: <input type="text" value={firstName}  onChange={OnTextChageFirstName}  />
                <div className="text-danger">{firstNameError}</div>
                <br/>
                Last Name: <input type="text" value={lastName} onChange={OnTextChageLastName}  />
                <div className="text-danger">{lastNameError}</div>
                <br/>
                Email:  <input  type="email"  value={email} onChange={OnTextChageEmail}  />
                <div className="text-danger">{emailError}</div>
                <br/>
                Password: <input type="password" value={password} onChange={OnTextChagePassword} />
                <div className="text-danger">{passwordError}</div>
                <br/>
                Mobile Number: <input type="tel" value={mobileNo} onChange={OnTextChagMobileNo} />
                <div className="text-danger">{mobileNoError}</div>
                <br/>
                UserType: <select value={userType} onChange={OnTextChageUserType}>
                            <option value="0">Owner</option>
                            <option value="1">Customer</option>
                            </select>
                <div className="text-danger">{userTypeError}</div>     
                <br/>
                <br/>
                <button className="btn btn-primary" onClick={Validate}> Register</button>
            </form> 
          </center>
      </div>
    );
  
}

export default Register;
